import React , {Component} from 'react';

class BoardView extends Component{
    constructor(props){
        super(props);
        let data = this.props.location.state;
        this.state = {
            id: data.id,
            userEmail: data.userEmail,
            fat: data.fat,
            test: data.test,
            // id:this.props.match.params.id,
            // boardEmail: '',
            // title: '',
            // content: '',
            // comment: [],
            // regDate:'',
        }
    }



    render(){
        const {data} = this.state;
        return(
            <div>
                id: {data.id}  <br/>
                boardEmail : {data.boardEmail} <br/>
                fat : {data.title} <br/>
                test : {data.content} <br/>
            </div>
        )
    }
}

export default BoardView;
